import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";

export default function Detalle(){
    const { id } = useParams();
    const personaje = useSelector((state) => state.personajes);
    const cache = personaje.filter((e)=> e.id === id)
    return(
        <div>
            <h1>{cache.id}</h1>
        </div>
    )
}
